import React from 'react';
import './index.css';

class Header extends React.Component {
    render() {
        return (
            <main>
            <div className="container">
              <header className="header">
                <link className="button-blog">
                    BLOG
                </link>
                <button>
                    <link>Login</link>
                </button>
                <button>
                    <link>Register</link>
                </button>
              </header>
            </div>
          </main>
        )
    }
}

export default Header;
